  \"Assessing the Importance of Horseshoe Crab (Limulus polyphemus) Eggs in the Diets
  of Migrating Red Knots (Calidris canutus rufa) and Sanderlings (Calidris alba) During
  Refueling Stops on Selected Florida Beaches\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  49,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-07-23T03:28:10.801366\",\n\t\"name\": \"assessing-the-importance-of-horseshoe-crab-limulus-polyphemus-eggs-in-the-diets-of-migrati\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The projects main goals are to look at
  the diet content, habitat use, and body  condition of migratory red knots and sanderlings
  and to examine these factors relationship to horseshoe crab egg availability and
  abundance. Please see attached SWG grant proposal. This grant was successfully funded
  and all research objectives are based on this grant. During each season late FebMay
  for all three study regions combined Panhandle, Cedar Key and Tampa Bay we propose
  to band up to 500 birds, sample blood from up to 200 birds for plasma metabolite
  analysis, and collect diet samples from up to 100 birds. St. Vincents NWR would
  possibly comprise between 510 of these total numbers. These sample sizes were selected
  based on our ability to gain statistical significance from our data and the feasibility
  of capturing birds. We would also be conducting shorebird surveys on a regular basis,
  but this would not interfere with the normal behaviors of the birds. Additionally
  we would be collecting sediment core samples from areas where birds are foragingcaptured.\",\n\t\"license_title\":
